import React from "react";
import {
  Bio,
  Container,
  Img,
  Name,
  ProfileDetails,
  ProfileWrapper,
} from "./Header.styled";

const Header = () => {
  return (
    <Container>
      <ProfileWrapper>
        <Img
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRQ--rJ7Xa-1PtEpg5FjvgqjKda1FF9lUKrvg&usqp=CAU"
          alt="profile"
        />
      </ProfileWrapper>
      <ProfileDetails>
        <Name>
          <p>Santhsoh Prabhakaran</p>
        </Name>
        <Bio>
          <Name>
            <p>Santhsoh Prabhakaran</p>
          </Name>
          <p></p>
        </Bio>
      </ProfileDetails>
    </Container>
  );
};

export default Header;
